import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the first visible product card using a unique selector
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Use XPath to click the first product card (div with class 'product-card' and an img inside)
    const productCardHandles = await page.$x("//div[contains(@class, 'product-card')][.//img]");
    if (productCardHandles.length === 0) throw new Error('No product card found');
    await productCardHandles[0].click();

    // Wait for the modal to appear by waiting for .modal#productModal with style display: block
    await page.waitForSelector('#productModal', { timeout: 5000 });
    // Wait for modal to be visible (display: block)
    await page.waitForFunction(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display !== 'none';
    }, { timeout: 5000 });

    // Wait for product detail content to load inside the modal
    await page.waitForSelector('#productDetail', { timeout: 5000 });

    // Take screenshot of the opened modal
    const modalShot = path.join(screenshotsDir, 'step_2_modal_open.png');
    await page.screenshot({ path: modalShot });
    screenshots.push(modalShot);

    // Extract product title and price from the modal
    const extractedData = await page.evaluate(() => {
      const title = document.querySelector('#productDetail .product-detail-title')?.textContent?.trim() || '';
      const price = document.querySelector('#productDetail .product-detail-price')?.textContent?.replace(/\s+/g, ' ').trim() || '';
      return { title, price };
    });

    return {
      success: true,
      action: "Opened the Product Detail Modal for the first product and extracted title and price",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
